    /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @param {?} infoBoxMetaData
     * @param {?} endLat
     * @param {?} endLong
     * @param {?} loadbtnClick
     * @return {?}
     */
    RttamaplibComponent.prototype.UpdateTicketDirections = /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @param {?} infoBoxMetaData
     * @param {?} endLat
     * @param {?} endLong
     * @param {?} loadbtnClick
     * @return {?}
     */
    function (that, map, dirManager, infoBoxMetaData, endLat, endLong, loadbtnClick) {
        Microsoft.Maps.loadModule('Microsoft.Maps.Directions', function () {
            /** @type {?} */
            var mapZoomLevel = 10;
            dirManager = new Microsoft.Maps.Directions.DirectionsManager(map);
            dirManager.clearAll();
            map.layers.clear();
            // Set Route Mode to driving
            dirManager.setRequestOptions({
                routeMode: Microsoft.Maps.Directions.RouteMode.driving,
                routeDraggable: true
            });
            dirManager.setRenderOptions({
                drivingPolylineOptions: {
                    strokeColor: Microsoft.Maps.Color.fromHex('#009fdb'),
                    strokeThickness: 5
                },
                firstWaypointPushpinOptions: { visible: false, text: '', },
                //icon: 'data:image/png;base64,'
                lastWaypointPushpinOptions: {
                    visible: true, text: '',
                    icon: 'data:image/png;base64,'
                },
                viapointPushpinOptions: {
                    visible: false,
                },
                waypointPushpinOptions: { visible: false },
                autoUpdateMapView: true,
                displayRouteSelector: false
            });
            //dirManager.showInputPanel('directionsPanel');
            if (that.currentLatitude != undefined && that.currentLongitude != undefined) {
                /** @type {?} */
                var waypoint1 = new Microsoft.Maps.Directions.Waypoint({
                    location: new Microsoft.Maps.Location(that.currentLatitude, that.currentLongitude)
                });
                dirManager.addWaypoint(waypoint1);
            }
            console.log("current Latitude: " + that.currentLatitude + "current Logitute: " + that.currentLongitude);
            /** @type {?} */
            var waypoint2 = new Microsoft.Maps.Directions.Waypoint({
                location: new Microsoft.Maps.Location(endLat, endLong),
            });
            dirManager.addWaypoint(waypoint2);
            console.log("destination Latitude: " + endLat + "destination Logitute: " + endLong);
            $("#mdticketLoading").show();
            if (loadbtnClick == "1") {
                if (that.singleView != 'Yes') {
                    $("#singleviewmodalcontent").html(that.getTicketModalHTML(infoBoxMetaData, '', '', ''));
                    $("#mdticketLoading").show();
                    jQuery("#ticketmodal").modal();
                    if (that.currentLatitude == undefined && that.currentLongitude == undefined) {
                        $("#mdticketLoading").hide();
                        $("#mdticketErrorMessage").show();
                    }
                }
                $("#mdticketMap").hide();
                $("#mdticketDistance").hide();
                $("#mdticketFromAddress").hide();
                $("#mdticketToAddress").hide();
                $("#ticketmodal").on("hidden.bs.modal", function () {
                    if (that.singleView != 'Yes') {
                        dirManager.clearAll();
                        map.layers.clear();
                        map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), mapZoomLevel: mapZoomLevel });
                    }
                    that.UpdatepinClicked(that, infoBoxMetaData, 2);
                });
                $(".close").click(function () {
                    if (that.singleView != 'Yes') {
                        dirManager.clearAll();
                        map.layers.clear();
                        map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), mapZoomLevel: mapZoomLevel });
                    }
                    that.UpdatepinClicked(that, infoBoxMetaData, 2);
                });
                $("#tktId").click(function () {
                    that.UpdatepinClicked(that, infoBoxMetaData, 1);
                });
                /** @type {?} */
                var xflag = 0;
                $("#moreFormContentBtn").click(function () {
                    // console.log('called click');
                    if (xflag == 0) {
                        $("#initFormContent").hide();
                        $("#moreFormContent").slideToggle("slow");
                        $("#dummyimage").attr("src", "data:image/png;base64,");
                        xflag = 1;
                    }
                    else if (xflag == 1) {
                        $("#moreFormContent").hide();
                        $("#initFormContent").slideToggle("slow");
                        $("#dummyimage").attr("src", "data:image/png;base64,");
                        xflag = 0;
                    }
                });
                if (that.singleview == 'Yes') ;
            }
            Microsoft.Maps.Events.addHandler(dirManager, 'directionsUpdated', function (e) {
                //that.pathLayer.clear();
                that.directionUpdated = "1";
                console.log('diraction updated');
                /** @type {?} */
                var allWayPoints = dirManager.getAllWaypoints();
                /** @type {?} */
                var fromAddress = allWayPoints[0].getAddress();
                /** @type {?} */
                var toAddress = allWayPoints[1].getAddress();
                /** @type {?} */
                var routeIndex = e.route[0].routeLegs[0].originalRouteIndex;
                /** @type {?} */
                var nextLocation = e.route[0].routePath[routeIndex + 1];
                /** @type {?} */
                var routeIdx = dirManager.getRequestOptions().routeIndex;
                /** @type {?} */
                var distance = Math.round(e.routeSummary[routeIdx].distance * 100) / 100;
                /** @type {?} */
                var units = dirManager.getRequestOptions().distanceUnit;
                /** @type {?} */
                var distanceUnits = '';
                if (units === Microsoft.Maps.Directions.DistanceUnit.km) {
                    distanceUnits = 'km';
                }
                else {
                    // Must be in miles
                    distanceUnits = 'miles';
                }
                /** @type {?} */
                var time = Math.round(e.routeSummary[routeIdx].timeWithTraffic / 60);
                /** @type {?} */
                var distanceData = "<label style='font-weight:bold; font-size:24px;'>" + distance + '&nbsp;' + distanceUnits + ", </label>Traffic: " + time + " minutes";
                $("#ticketdistancedata").html(distanceData);
                $("#ticketfromaddress").text(fromAddress);
                $("#tickettoaddress").text(toAddress);
                $("#mdticketLoading").hide();
                $("#mdticketErrorMessage").hide();
                $("#mdticketMap").show();
                $("#mdticketDistance").show();
                $("#mdticketFromAddress").show();
                $("#mdticketToAddress").show();
                if (that.singleView == 'Yes') {
                    map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), zoom: 10 });
                    $("#startButtonLink").click(function () {
                        //we're on iOS, open in Apple Maps
                        if ((navigator.platform.indexOf("iPhone") != -1) ||
                            (navigator.platform.indexOf("iPad") != -1) ||
                            (navigator.platform.indexOf("iPod") != -1)) {
                            window.open("maps://maps.google.com/maps/dir/" + fromAddress + "/" + toAddress + "");
                        }
                        else {
                            window.open("https://maps.google.com/maps/dir/" + fromAddress + "/" + toAddress + "");
                        }
                    });
                }
            });
            dirManager.calculateDirections();
        });
    };
