    /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @return {?}
     */
    RttamaplibComponent.prototype.loadCurrentLocation = /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @return {?}
     */
    function (that, map, dirManager) {
        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(function (position) {
                /** @type {?} */
                var loc = new Microsoft.Maps.Location(position.coords.latitude, position.coords.longitude);
                /** @type {?} */
                var currentLocImage = 'data:image/png;base64,';
                /** @type {?} */
                var pin = new Microsoft.Maps.Pushpin(loc, { icon: currentLocImage });
                map.entities.push(pin);
                // Center the map on the user's location.
                // maps.setView({ center: loc, zoom: 15 });
                that.currentLatitude = position.coords.latitude;
                that.currentLongitude = position.coords.longitude;
                console.log('current location loaded.');
                if (that.singleView == 'Yes' && that.directionUpdated == "0") {
                    // map.entities.clear();
                    // map.layers.clear();
                    // var pin = new Microsoft.Maps.Pushpin(loc, { icon: currentLocImage });
                    // map.entities.push(pin);
                    // that.addTicketData(that, map, dirManager, "0");
                    console.log('Get Job loading direction again.');
                    that.UpdateTicketDirections(that, map, dirManager, that.ticketList[0].FieldTupleList.FieldTuple, that.ticketList[0].FieldTupleList.FieldTuple.Latitude, that.ticketList[0].FieldTupleList.FieldTuple.Longitude, "0");
                }
                else if (that.singleView != 'Yes' && that.directionUpdated == "0" && that.selectedticketNo != undefined) {
                    console.log('loading direction again.');
                    that.UpdateTicketDirections(that, map, dirManager, that.selectedPushpinData, that.selectedPushpinData.Latitude, that.selectedPushpinData.Longitude, "0");
                }
            }, function (positionError) {
                if (that.singleView == 'Yes') {
                    $("#mdticketLoading").hide();
                    $("#mdticketErrorMessage").show();
                    $("#startButtonLink").click(function () {
                        //we're on iOS, open in Apple Maps
                        if ((navigator.platform.indexOf("iPhone") != -1) ||
                            (navigator.platform.indexOf("iPad") != -1) ||
                            (navigator.platform.indexOf("iPod") != -1)) {
                            window.open("maps://maps.google.com/maps?daddr=" + that.ticketList[0].FieldTupleList.FieldTuple.Latitude + "," + that.ticketList[0].FieldTupleList.FieldTuple.Longitude + "&amp;ll=");
                        }
                        else {
                            window.open("https://maps.google.com/maps?daddr=" + that.ticketList[0].FieldTupleList.FieldTuple.Latitude + "/" + that.ticketList[0].FieldTupleList.FieldTuple.Longitude + "&amp;ll=");
                        }
                    });
                }
            });
        }
    };
    /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @param {?} loadPopupClick
     * @return {?}
     */
    RttamaplibComponent.prototype.addTicketData = /**
     * @param {?} that
     * @param {?} map
     * @param {?} dirManager
     * @param {?} loadPopupClick
     * @return {?}
     */
    function (that, map, dirManager, loadPopupClick) {
        var _this = this;
        /** @type {?} */
        var mapZoomLevel = 10;
        this.ticketList.forEach(function (data) {
            if (data.FieldTupleList.FieldTuple.Latitude != '' && data.FieldTupleList.FieldTuple.Longitude != '') {
                /** @type {?} */
                var ticketCount = data.ticketCount == undefined ? '' : data.ticketCount;
                /** @type {?} */
                var ticketImage = "data:image/png;base64,";
                if (data.FieldTupleList.FieldTuple.TicketSeverity.toLowerCase() === "unknown" || data.FieldTupleList.FieldTuple.TicketSeverity.toLowerCase() === "warning" || data.FieldTupleList.FieldTuple.TicketSeverity.toLowerCase() === "minor") {
                    ticketImage = "data:image/png;base64,";
                }
                else if (data.FieldTupleList.FieldTuple.TicketSeverity.toLowerCase() === "major") {
                    ticketImage = "data:image/png;base64,";
                }
                /** @type {?} */
                var pushpin = new Microsoft.Maps.Pushpin(new Microsoft.Maps.Location(data.FieldTupleList.FieldTuple.Latitude, data.FieldTupleList.FieldTuple.Longitude), { icon: ticketImage, text: ticketCount.toString() });
                pushpin.metadata = data.FieldTupleList.FieldTuple;
                map.entities.push(pushpin);
                _this.dataLayer.push(pushpin);
                map.setView({ mapTypeId: Microsoft.Maps.MapTypeId.road, center: new Microsoft.Maps.Location(data.FieldTupleList.FieldTuple.Latitude, data.FieldTupleList.FieldTuple.Longitude) });
                if (that.singleView == 'Yes') {
                    loadTicketDirections(that, data.FieldTupleList.FieldTuple, data.FieldTupleList.FieldTuple.Latitude, data.FieldTupleList.FieldTuple.Longitude, loadPopupClick);
                }
                else {
                    Microsoft.Maps.Events.addHandler(pushpin, 'click', pushpinClicked);
                }
                if (data.FieldTupleList.FieldTuple.TicketNumber == _this.selectedticketNo) {
                    _this.selectedPushpin = pushpin;
                    _this.selectedPushpinData = data.FieldTupleList.FieldTuple;
                }
            }
        });
        mapZoomLevel = map.getZoom();
        /** @type {?} */
        var pins = map.entities;
        /** @type {?} */
        var pushpins = [];
        for (var i = 0; i < pins.getLength(); i++) {
            pushpins.push(pins.get(i));
        }
        console.log(pins);
        if (pushpins) {
            map.setView({
                bounds: Microsoft.Maps.LocationRect.fromShapes(pushpins),
                padding: 100 //Add a padding to buffer map to account for pushpin pixel dimensions
            });
        }
        if (this.selectedPushpin) {
            window.setTimeout(function () {
                console.log('pushpins[0]:', _this.selectedPushpin);
                Microsoft.Maps.Events.invoke(_this.selectedPushpin, 'click', { target: _this.selectedPushpin });
            }, 3000);
        }
        /**
         * @param {?} e
         * @return {?}
         */
        function pushpinClicked(e) {
            if (e.target.metadata) {
                /** @type {?} */
                var ll = e.target.getLocation();
                loadTicketDirections(that, e.target.metadata, ll.latitude, ll.longitude, "1");
            }
            $('.NavBar_Container.Light').attr('style', 'bottom:30px;top:unset !important;');
            pinClicked(e.target.metadata, 0);
        }
        /** @type {?} */
        var distanceData = "";
        /**
         * @param {?} parms
         * @param {?} lauchTicketCard
         * @return {?}
         */
        function pinClicked(parms, lauchTicketCard) {
            /** @type {?} */
            var selectedTicket = {
                "SelectedTicket": {
                    "TicketNumber": parms.TicketNumber,
                    "LaunchTicketCard": lauchTicketCard
                }
            };
            console.log('Selected Ticket: ' + parms.TicketNumber + 'launchTicket: ' + lauchTicketCard);
            that.ticketClick.emit(selectedTicket);
        }
        /**
         * @param {?} that
         * @param {?} infoBoxMetaData
         * @param {?} endLat
         * @param {?} endLong
         * @param {?} loadbtnClick
         * @return {?}
         */
        function loadTicketDirections(that, infoBoxMetaData, endLat, endLong, loadbtnClick) {
            Microsoft.Maps.loadModule('Microsoft.Maps.Directions', function () {
                dirManager = new Microsoft.Maps.Directions.DirectionsManager(map);
                dirManager.clearAll();
                map.layers.clear();
                // Set Route Mode to driving
                dirManager.setRequestOptions({
                    routeMode: Microsoft.Maps.Directions.RouteMode.driving,
                    routeDraggable: true
                });
                dirManager.setRenderOptions({
                    drivingPolylineOptions: {
                        strokeColor: Microsoft.Maps.Color.fromHex('#009fdb'),
                        strokeThickness: 5
                    },
                    firstWaypointPushpinOptions: { visible: false, text: '', },
                    //icon: 'data:image/png;base64,'
                    lastWaypointPushpinOptions: {
                        visible: true, text: '',
                        icon: 'data:image/png;base64,'
                    },
                    viapointPushpinOptions: {
                        visible: false,
                    },
                    waypointPushpinOptions: { visible: false },
                    autoUpdateMapView: true,
                    displayRouteSelector: false
                });
                //dirManager.showInputPanel('directionsPanel');
                if (that.currentLatitude != undefined && that.currentLongitude != undefined) {
                    /** @type {?} */
                    var waypoint1 = new Microsoft.Maps.Directions.Waypoint({
                        location: new Microsoft.Maps.Location(that.currentLatitude, that.currentLongitude)
                    });
                    dirManager.addWaypoint(waypoint1);
                }
                console.log("current Latitude: " + that.currentLatitude + "current Logitute: " + that.currentLongitude);
                /** @type {?} */
                var waypoint2 = new Microsoft.Maps.Directions.Waypoint({
                    location: new Microsoft.Maps.Location(endLat, endLong),
                });
                dirManager.addWaypoint(waypoint2);
                console.log("destination Latitude: " + endLat + "destination Logitute: " + endLong);
                $("#mdticketLoading").show();
                if (loadbtnClick == "1") {
                    if (that.singleView != 'Yes') {
                        $("#singleviewmodalcontent").html(that.getTicketModalHTML(infoBoxMetaData, '', '', ''));
                        $("#mdticketLoading").show();
                        jQuery("#ticketmodal").modal();
                        if (that.currentLatitude == undefined && that.currentLongitude == undefined) {
                            $("#mdticketLoading").hide();
                            $("#mdticketErrorMessage").show();
                        }
                    }
                    $("#mdticketMap").hide();
                    $("#mdticketDistance").hide();
                    $("#mdticketFromAddress").hide();
                    $("#mdticketToAddress").hide();
                    $("#ticketmodal").on("hidden.bs.modal", function () {
                        if (that.singleView != 'Yes') {
                            dirManager.clearAll();
                            map.layers.clear();
                            map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), mapZoomLevel: mapZoomLevel });
                        }
                        pinClicked(infoBoxMetaData, 2);
                    });
                    $(".close").click(function () {
                        if (that.singleView != 'Yes') {
                            dirManager.clearAll();
                            map.layers.clear();
                            map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), mapZoomLevel: mapZoomLevel });
                        }
                        pinClicked(infoBoxMetaData, 2);
                    });
                    $("#tktId").click(function () {
                        pinClicked(infoBoxMetaData, 1);
                    });
                    /** @type {?} */
                    var xflag = 0;
                    $("#moreFormContentBtn").click(function () {
                        // console.log('called click');
                        if (xflag == 0) {
                            $("#initFormContent").hide();
                            $("#moreFormContent").slideToggle("slow");
                            $("#dummyimage").attr("src", "data:image/png;base64,");
                            xflag = 1;
                        }
                        else if (xflag == 1) {
                            $("#moreFormContent").hide();
                            $("#initFormContent").slideToggle("slow");
                            $("#dummyimage").attr("src", "data:image/png;base64,");
                            xflag = 0;
                        }
                    });
                    if (that.singleview == 'Yes') ;
                }
                Microsoft.Maps.Events.addHandler(dirManager, 'directionsUpdated', function (e) {
                    //that.pathLayer.clear();
                    that.directionUpdated = "1";
                    console.log('diraction updated');
                    /** @type {?} */
                    var allWayPoints = dirManager.getAllWaypoints();
                    /** @type {?} */
                    var fromAddress = allWayPoints[0].getAddress();
                    /** @type {?} */
                    var toAddress = allWayPoints[1].getAddress();
                    /** @type {?} */
                    var routeIndex = e.route[0].routeLegs[0].originalRouteIndex;
                    /** @type {?} */
                    var nextLocation = e.route[0].routePath[routeIndex + 1];
                    /** @type {?} */
                    var routeIdx = dirManager.getRequestOptions().routeIndex;
                    /** @type {?} */
                    var distance = Math.round(e.routeSummary[routeIdx].distance * 100) / 100;
                    /** @type {?} */
                    var units = dirManager.getRequestOptions().distanceUnit;
                    /** @type {?} */
                    var distanceUnits = '';
                    if (units === Microsoft.Maps.Directions.DistanceUnit.km) {
                        distanceUnits = 'km';
                    }
                    else {
                        // Must be in miles
                        distanceUnits = 'miles';
                    }
                    /** @type {?} */
                    var time = Math.round(e.routeSummary[routeIdx].timeWithTraffic / 60);
                    distanceData = "<label style='font-weight:bold; font-size:18px;'>" + distance + '&nbsp;' + distanceUnits + ", </label>Traffic: " + time + " minutes";
                    $("#ticketdistancedata").html(distanceData);
                    $("#ticketfromaddress").text(fromAddress);
                    $("#tickettoaddress").text(toAddress);
                    $("#mdticketLoading").hide();
                    $("#mdticketErrorMessage").hide();
                    $("#mdticketMap").show();
                    $("#mdticketDistance").show();
                    $("#mdticketFromAddress").show();
                    $("#mdticketToAddress").show();
                    if (that.singleView == 'Yes') {
                        map.setView({ center: new Microsoft.Maps.Location(endLat, endLong), zoom: 10 });
                        $("#startButtonLink").click(function () {
                            //we're on iOS, open in Apple Maps
                            if ((navigator.platform.indexOf("iPhone") != -1) ||
                                (navigator.platform.indexOf("iPad") != -1) ||
                                (navigator.platform.indexOf("iPod") != -1)) {
                                window.open("maps://maps.google.com/maps/dir/" + fromAddress + "/" + toAddress + "");
                            }
                            else {
                                window.open("https://maps.google.com/maps/dir/" + fromAddress + "/" + toAddress + "");
                            }
                        });
                    }
                });
                dirManager.calculateDirections();
            });
        }
    };
